import React, { useState } from 'react';
import logo from './logo.svg';
import './App.css';
import Button from '@material-ui/core/Button';
import ButtonGroup from '@material-ui/core/ButtonGroup';
import SaveIcon from '@material-ui/icons/Save'
import DeleteIcon from '@material-ui/icons/Delete'
import Checkbox from '@material-ui/core/Checkbox';

const CheckboxExample = () => {
  const [checked, setChecked] = useState(false)
  return (
    <div>
      <Checkbox checked={checked} onChange={(e) => setChecked(e.target.checked)} inputProps={{ 'aria-label' : ''}} />
    </div>
  )
}

const App = () =>  {
  return (
    <div className="App">
      <header className="App-header">
        <CheckboxExample />
      <ButtonGroup >
        <Button startIcon={<SaveIcon/>} size="large" variant="contained" color="primary">
          Save
        </Button>
        <Button startIcon={<DeleteIcon/>} size="large" variant="contained" color="secondary">
          Delete
        </Button>
      </ButtonGroup>
        <img src={logo} className="App-logo" alt="logo" />
      </header>
    </div>
  );
}

export default App;
